import React, { Fragment } from 'react';
import { View } from 'react-native';

// Components
import CustomText from './CustomText';

function Offers() {
	return (
		<Fragment>
			<View style={{ flexDirection: 'row' }}>
				<CustomText>پیشنهاد ویژه</CustomText>
			</View>
		</Fragment>
	);
}

export default Offers;
